package tn.esprit.hexacode.controller;

import java.io.File;

import javax.mail.MessagingException;
import javax.mail.internet.MimeMessage;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.core.io.FileSystemResource;
import org.springframework.mail.SimpleMailMessage;
import org.springframework.mail.javamail.JavaMailSender;
import org.springframework.mail.javamail.MimeMessageHelper;
import org.springframework.stereotype.Controller;
import org.springframework.web.bind.annotation.PathVariable;
import org.springframework.web.bind.annotation.RequestBody;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.ResponseBody;



import tn.esprit.hexacode.MyConstants;
import tn.esprit.hexacode.Entity.Event;
import tn.esprit.hexacode.Entity.Reservation;
import tn.esprit.hexacode.repository.EventRepository;
@Controller
public class MailController {
	@Autowired
    public JavaMailSender emailSender;
	@Autowired
	EventRepository eventRepository ;
	

    @ResponseBody
    @RequestMapping("/sendSimpleEmail")
    public String sendSimpleEmail() {

        // Create a Simple MailMessage.
        SimpleMailMessage message = new SimpleMailMessage();
        
        message.setTo(MyConstants.FRIEND_EMAIL);
        message.setSubject("about your reservation");
        message.setText("your reservation is confirmed please be at time and have a good day ");

        // Send Message!
        this.emailSender.send(message);

        return "Email Sent!";
    }

    
    @ResponseBody
    @RequestMapping("/sendAttachmentEmail")
    public String sendAttachmentEmail() throws MessagingException
    {

        MimeMessage message = emailSender.createMimeMessage();

        boolean multipart = true;

        MimeMessageHelper helper = new MimeMessageHelper(message, multipart);

        helper.setTo(MyConstants.FRIEND_EMAIL);
        helper.setSubject("Test email with attachments");
        
        helper.setText("Hello, Im testing email with attachments!");
        
        String path1 = "C:/Users/MSI/Desktop/Lend-Me (2).pptx";
//        String path2 = "/home/tran/Downloads/readme.zip";

        // Attachment 1
        FileSystemResource file1 = new FileSystemResource(new File(path1));
        helper.addAttachment("Txt file", file1);

//        // Attachment 2
//        FileSystemResource file2 = new FileSystemResource(new File(path2));
//        helper.addAttachment("Readme", file2);

        emailSender.send(message);

        return "Email Sent!";
    }
    
    @ResponseBody
    @RequestMapping("/sendHtmlEmail/{event-id}")
    public String sendHtmlEmail(@RequestBody Reservation res ,  @PathVariable("event-id") long id) throws MessagingException {

    	//ObjectMapper objectMapper = new ObjectMapper();
    	//String jsonString = objectMapper.writeValueAsString(Event event);
    	MimeMessage message = emailSender.createMimeMessage();
    	
        //Reservation res = new Reservation() ;
      Event event = eventRepository.findById(id).get();    
        boolean multipart = true;
        
        MimeMessageHelper helper = new MimeMessageHelper(message, multipart, "utf-8");
        
        String htmlMsg = "<h3>your reservation is confirmed </h3>"
        		+"  -------------------------"
				+ "                        <p >Dear Mr/Miss "+res.getNom() + "  " +"your reservation is confirmed please be at time the "
        		+event.getDate()
		        +" at" +"  "+event.getLocation()+"  <p > and don't forget your masks please                        </p>"
		        
		        +"<img src='data:image/png;base64,'>";
        
        message.setContent(htmlMsg, "text/html");
        
        helper.setTo(res.getMail());
        
        helper.setSubject("Event Pass");
        
    
        this.emailSender.send(message);

        return "Email Sent!";
    }

   
}
